import { Routes, Route } from 'react-router-dom';

function App() {
  return (
    <Routes>
      <Route path="/" element={<HomePage />} />
      <Route path="/about" element={<AboutPage />} />
    </Routes>
  );
}

function HomePage() {
  return <h1>Welcome to the Home Page!</h1>;
}

function AboutPage() {
  return <h1>About Us</h1>;
}
